(4, 'C1', 1, 'Used', 'Numerous faint and a few more pronounced scratches visible upon quick inspection', '<p>Several blemishes (scratches, scuffs) visible upon quick inspection</p>\r\n\r\n<p>The screens on the C1 grade will show more signs of use compared to the B2 grade.</p>', NULL, NULL, NULL, 1, NULL, '2022-05-19 23:21:54', '2022-05-19 23:21:54'),
(5, 'C2', 1, 'Heavily used', 'Extensive, pronounced scratches, easily visible upon quick inspection', '<p>&nbsp;Extensive, pronounced blemishes (scratches, scuffs), easily visible upon quick inspection</p>', NULL, NULL, NULL, 1, NULL, '2022-05-19 23:23:47', '2022-05-19 23:23:47'),
(6, 'KFCG', 1, NULL, '• Working LCD • The device will have cracked glass on the front and/or back • A small percentage may have an LCD blemish', NULL, 'Devices have not been cosmetically graded and will vary in appearance.', NULL, NULL, 1, NULL, '2022-05-19 23:45:44', '2022-05-19 23:45:44'),
(7, 'KFLB', 1, NULL, '• Working LCD • The device will have a blemish on the LCD (white spot, yellow spot, burned image, discolored LCD, or halo)', NULL, 'Devices have not been cosmetically graded and will vary in appearance.', NULL, NULL, 1, NULL, '2022-05-19 23:47:02', '2022-05-19 23:47:02'),
(8, 'PGL', 2, NULL, 'No cracks', NULL, NULL, '<ul>\r\n	<li>&nbsp;Power on</li>\r\n	<li>&nbsp;Good LCD</li>\r\n	<li>One or more non-key functions do not work</li>\r\n</ul>', 'No LCD blemish (see KFLB or PLB for definition of LCD blemish)', 1, NULL, '2022-05-19 23:52:05', '2022-05-19 23:52:05'),
(9, 'PCG', 2, NULL, 'The device will have cracked glass on the front and/or back', NULL, NULL, '<ul>\r\n	<li>Power on</li>\r\n	<li>One or more non-key functions do not work</li>\r\n</ul>', 'Small percentage may have an LCD blemish (see KFLB or PLB for definition of LCD blemish)', 1, NULL, '2022-05-19 23:53:55', '2022-05-19 23:53:55'),
(10, 'PLB', 2, NULL, 'No cracks', NULL, NULL, '<ul>\r\n	<li>Power on</li>\r\n	<li>One or more non-key functions do not work</li>\r\n</ul>', 'LCD blemish (white spot, yellow spot, discolored LCD, burned image, or halo)', 1, NULL, '2022-05-19 23:55:16', '2022-05-19 23:55:16'),
